import React from 'react';
import {Container,Col,Row} from 'react-bootstrap'
const AfficheVoiture = (props) => {
    const {Voiture} = props
    return (
        <Container>
                <p> AfficheVoiture {Voiture.marque} </p> 
                <p> model {Voiture.model} </p> 

        </Container>
    );
};

export default AfficheVoiture;
